    value: "Your letter from January 11, 2007:  1.\t1. The SCGOP applies the following
      Best Effort procedure:  first, our original solicitation includes a clear and
      conspicuous request for the contributor information and informs the contributor
      of the requirements of federal law for the reporting of such information.  If
      the information is not provided, we make one follow-up, stand alone effort to
      obtain the information within 30 days of the receipt of the contribution, either
      by letter or telephone.  If we receive the contributor information, we file
      it with our next report.  2. The expenditures made for postage on Schedule B
      were not made on behalf of specifically identified federal candidates for Federal
      office and did not promote, oppose, attack, or support a candidate for Federal
      office.  3. The payments for catering on Schedule B were not made on behalf
      of specifically identified federal candidates.     4. The payments on Schedule
      H4 for federal and state payroll taxes, health insurance, insurance, ITEMIZE:
      insurance, and net pay were for employees who did not spend 25% or more of their
      time on FEA or activities in connection with a Federal election. 4. The payments
      for contract labor/janitor were made to an individual who is not our employee.
      \ He is a self employed individual who has a janitorial service and other clients
      and we hired him to clean our offices.  5. We have amended the report to show
      the proper allocation ratio on schedule H 1 and H4. Furthermore, we have repaid
      the overpayment to our nonfederal account on October 2007 and reported this
      in our November 2007 report."
